using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class NStructureBoltHoleSizeModel : Notifier	{		public NStructureBoltHoleSizeModel()		{					Size = "";			Hole = "";			SlotHole = "";		}				private string _Size;		public string Size			{				get { return _Size; }				set				{					_Size = value;					OnPropertyChanged(nameof(Size));				}			}				private string _Hole;		public string Hole			{				get { return _Hole; }				set				{					_Hole = value;					OnPropertyChanged(nameof(Hole));				}			}				private string _SlotHole;		public string SlotHole			{				get { return _SlotHole; }				set				{					_SlotHole = value;					OnPropertyChanged(nameof(SlotHole));				}			}			}}